import React from "react";
import {useNavigate, useParams} from "react-router-dom";

function Movie(){
    let navigate = useNavigate();
    let {id} = useParams();
    return (
        <div>
            <h1>Movie</h1>
            <button onClick={() => navigate("/")}>Go Home</button>
        </div>
    );
}
export default Movie;
